import * as React from 'react';
import PropTypes from 'prop-types';
import clsx from 'clsx';   
import { useHistory } from 'react-router'; 
import { withStyles, makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';

const useStyles = makeStyles({
  table: {
    minWidth: 700,
  },
  tableRow:{
    backgroundColor: '#1976d2', 
    position:'fidex'
  },
  headCell:{
    color: '#FFFFFF', 
  } ,
  body:{
   maxHeigth:'20vh'
  } ,
  container: {
    maxHeight: 440,
  },
});


const MedicosTabla = () => {
  const classes = useStyles();

  let history = useHistory();




function createData(name, calories, fat, carbs, protein) {
  return { name, calories, fat, carbs, protein };
}

const rows = [
  createData('Frozen yoghurt', 159, 6.0, 24, 4.0),
  createData('Ice cream sandwich', 237, 9.0, 37, 4.3),
  createData('Eclair', 262, 16.0, 24, 6.0),
  createData('Cupcake', 305, 3.7, 67, 4.3),
  createData('Gingerbread', 356, 16.0, 49, 3.9),
  createData('Frozen yoghurt', 159, 6.0, 24, 4.0),
  createData('Ice cream sandwich', 237, 9.0, 37, 4.3),
  createData('Eclair', 262, 16.0, 24, 6.0),
  createData('Cupcake', 305, 3.7, 67, 4.3),
  createData('Gingerbread', 356, 16.0, 49, 3.9),
  createData('Frozen yoghurt', 159, 6.0, 24, 4.0),
  createData('Ice cream sandwich', 237, 9.0, 37, 4.3),
  createData('Eclair', 262, 16.0, 24, 6.0),
  createData('Cupcake', 305, 3.7, 67, 4.3),
  createData('Gingerbread', 356, 16.0, 49, 3.9),
];
  return (
    <TableContainer className={classes.container}>
  <Table stickyHeader >
    <TableHead   className={classes.tableRow}  >
      <TableRow >
        <TableCell className={classes.headCell} >Nombre y Apellido</TableCell>
        <TableCell className={classes.headCell} align="right">Celular</TableCell>
        <TableCell className={classes.headCell} align="right">Email</TableCell>
        <TableCell className={classes.headCell} align="right">Matrícula N°</TableCell>
        <TableCell  className={classes.headCell} align="right">Estado</TableCell>
      </TableRow>
    </TableHead>
    <TableBody    >
      {rows.map((row) => (
        <TableRow key={row.name} hover>
          <TableCell component="th" scope="row">
            {row.name}
          </TableCell>
          <TableCell align="right">{row.calories}</TableCell>
          <TableCell align="right">{row.fat}</TableCell>
          <TableCell align="right">{row.carbs}</TableCell>
          <TableCell align="right">{row.protein}</TableCell>
        </TableRow>
      ))}
    </TableBody>
  </Table> 
  </TableContainer>
  );
}
export default MedicosTabla;
